namespace OpBot.Cards.WorkOrder
{
    public class Person
    {
        // Change this to demo to different people.
        // Make sure the username exists in the GetExperts() list
        public static string DEMO_USER = "satyan@microsoft.com";


        public static IEnumerable<Person> GetTechnicians()
        {
            yield return new Person
            {
                Name = "Arthur Wollocko",
                Photo = "data:image/png;base64,",
                Email = "AWOLLOCKO@microsoft.com"
            };
            yield return new Person
            {
                Name = "Matt Hidinger",
                Photo = "data:image/png;base64,",
                Email = "mahiding@microsoft.com"
            };
            yield return new Person
            {
                Name = "Satya Nadella",
                Photo = "data:image/png;base64,",
                Email = "satyan@microsoft.com"
            };
            yield return new Person
            {
                Name = "Michael Farnsworth",
                Photo = "data:image/png;base64,",
                Email = "MIFARNSWORTH@microsoft.com"
            };
            yield return new Person
            {
                Name = "Will Portnoy",
                Photo = "data:image/png;base64,",
                Email = "wportnoy@microsoft.com"
            };
        }

        /// <summary>
        /// Exclude the current "demo user" from the list of experts
        /// </summary>
        /// <returns></returns>
        public static IEnumerable<Person> GetExperts()
        {
            return GetTechnicians().Where(n => !string.Equals(n.Email, DEMO_USER, StringComparison.OrdinalIgnoreCase));
        }


        public Person()
        {

        }

        public Person(string email, string name)
        {
            Email = email;
            Name = name;
        }

        public string Photo { get; set; }
        public string Name { get; set; }

        public string Email { get; set; }


    }

}
